import React, { Component } from 'react';
import './Section.css';

class CodeProjects extends Component {

    projects;

    // props are :headerText :list of body
    constructor(props) {
        super(props);

        projects = getProjects();
      }

    // all the code projects
    getProjects() {
        return [{name: "PROJ 1", logline: "one sentence description", pageHTML: <div>DESCRIPTION</div>}]
    }

    render(){    
        return (
            <div id="code-projects">
                {this.projects.map((p) => <PopupButton name={p.name} logline={p.logline} pageHTML={p.pageHTML}/>)}
            </div>
        );
    }
}

export default CodeProjects;
